import React from 'react'

import {Dialog, Button, Divider, DialogContent, DialogTitle} from '@material-ui/core'
import IconButton from '@material-ui/core/IconButton'
import Typography from '@material-ui/core/Typography'

import {makeStyles} from '@material-ui/core/styles'

import NavigateNextIcon from '@material-ui/icons/NavigateNext';
import NavigateBeforeIcon from '@material-ui/icons/NavigateBefore';

const useStyles = makeStyles(theme => ({
  root: {
    position: "absolute",
    top: 0,
    marginTop: 10
  },
  title:{
    display: 'flex',
    justifyContent: 'flex-end',
    padding: 2,

    '& .MuiButton-label':{
      fontSize: 20,
    }

  },
  content: {
    padding: 0,
    marginTop: theme.spacing(1),
    marginBottom: theme.spacing(2),

    '& img': {
      height: 380, 
      width: "100%",
      marginBottom: theme.spacing(2),
    },

    '& .MuiTypography-h5': {
      fontWeight: theme.typography.fontWeightBold,
    },
    '& .MuiTypography-subtitle1': {
      fontWeight: theme.typography.fontWeightBold,
      opacity: 0.6,
      fontSize: theme.typography.subtitle1.fon
    },
  },

  next: {
    position: "absolute",
    top: '50%',
    right: 0
  },

  prev: {
    position: 'absolute',
    top: '50%',
    left: 0

  },






}))


function ProjectDialog({openDetail, setOpenDetail}) {
  const classes = useStyles()
  const [slideImage, setSlideImage] = React.useState(0)

  const handleSilde = (e, name) => {
    e.preventDefault()
      if (name === 'next')
        setSlideImage(oldValue => {
          return ++oldValue
        })
      else 
        setSlideImage(oldValue => {
          return --oldValue
        })
  }
  console.log(
      "this is old value",
      slideImage
    )

  return (
    <Dialog 
      open={openDetail} 
      maxWidth="xs" 
      onClose={()=>setOpenDetail(false)} 
      classes={{paper: classes.root}} >
      <DialogTitle className={classes.title}>
        <Button 
          color="secondary" 
          onClick={()=>setOpenDetail(false)}
          className={classes.closeButton}
          >
          X
        </Button>
      </DialogTitle>
      <Divider />
      <DialogContent 
        className={classes.content}
        >
        <img 
          src="https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg" 
        />
        <div className={classes.next}>
          <IconButton 
            onClick={(e, name="next") => handleSilde(e, name)}
            >
            <NavigateNextIcon fontSize='large'/>
          </IconButton>
        </div>
        <div className={classes.prev}>
          <IconButton
            onClick={(e, name="prev") => handleSilde(e, name)}
            >
            <NavigateBeforeIcon fontSize="large" />
          </IconButton>
        </div>
        <Typography 
          variant="h5"

        >
          Project Name
        </Typography>
        <Typography 
          variant="subtitle1"

        >
          this is a subtitle
        </Typography>

      </DialogContent>

    </Dialog>
  )
}

export default ProjectDialog
